import React, { useEffect, useState, useMemo } from "react";
// import Tenanttable from "./Tenanttable";
import axios from "axios";
import { FetchTenantList } from "./Action";
import { connect } from "react-redux";


const Tenantdata = (props) => {
    useEffect(() => {
        props.loadtenant();
    }, [])
    return (
        // props.tenant.loading?<div><h2>Loading...</h2></div>:
        // props.tenant.errmessage?<div><h2>{props.tenant.errmessage}</h2></div>:
        <div>
            <div className="card">
                <div className="card-header">
                    <h2>Tenants Data</h2>
                </div>
                <div className="card-body">
                    <table className="table table-bordered">
                        <thead className="bg-dark text-white">
                            <tr>
                                <td>Id</td>
                                <td>Tenant</td>
                                <td>Type</td>
                                <td>Admin User</td>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                props.tenant.tenantlist && props.tenant.tenantlist.map(item =>
                                    <tr key={item.id}>
                                        <td>{item.id}</td>
                                        <td>{item.tenant}</td>
                                        <td>{item.type}</td>
                                        <td>{item.userid}</td>
                                    </tr>
                                )
                            }

                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

const mapStateToProps = (state) => {
    return {
        tenant: state.tenant
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        loadtenant: () => dispatch(FetchTenantList())
    }
}


export default connect(mapStateToProps, mapDispatchToProps)(Tenantdata);
